import React from 'react';
import Navbar from "../components/navbar_unlog";
//import BarPhotoProfil from "../components/bar-photo-profil";
import '../styles/pages/_profil.scss';

const Profil = () => {
    return (
        <div>
            <Navbar />
            <div className="top-profil-container">
                <div className="profil-picture"></div>
                <div className="profil-description">
                    <li>
                        <ul>Nom</ul>
                        <ul>Prenom</ul>
                        <ul>Age</ul>
                        <ul>genre</ul>
                        <ul>orientation</ul>
                        <ul>origine/yeux/taille (ect.)</ul>
                    </li>
                </div>
            </div>
        </div>
    );
};

export default Profil;
